<meta charset = "utf-8">

<script>

	function pulaLinha() {
		document.write("<br>");		
	}

	function escreve(string) {
		document.write(string);
		pulaLinha();
	}

	var contador = 30;

	while(contador <= 40) {	

		if(contador != 33 && contador != 37){
			escreve(contador);	
		}
		contador ++;	
	}

	escreve("FIM");
</script>
